    partial class DataSimulator : DataCollector
    {
        readonly List<PointOfInterestSimulatedData> _poiSimulatedData;
        public DataSimulator()
        {
            this._poiSimulatedData = this.GetpoiSimulatedData();
        }



        public override List<JObject> GetTours()
        {

            var JerusalemPointsOfInterestsJSON = GetJerusalemPointsOfInterest().ToArray();

            var simulatedLocations = new List<dynamic>
            {
                new { Name = "Old City",City="Jerusalem",Caption ="A Tour along timeline",Description = "We invite you to join us for a journey into the fascinating layers of the past embedded in the history of the city’s stones. In a city such as Jerusalem, events of the past are never forgotten; rather, they return and leave their mark on today’s residents of Jerusalem.", image =@"" },
                new { Name = "Dead Sea",City="Ein Gedi",Caption ="How Low can you go?", Description = "The Dead Sea is a place of natural beauty, health and history. At Egged Tour we endeavor to offer you the very best Dead Sea tours. Relax at the Mineral Beach Resort, go on a desert safari or combine your Dead Sea tour with other remarkable destinations in Israel.Explore our Dead Sea tours below or go back to browse our most popular Israel tours.",image =@"" },
                new { Name = "Manhattan",City="New York",Caption ="The big apple", Description = "New York City’s most popular borough, the island of Manhattan, is brimming with top attractions, renowned landmarks and historic neighborhoods.",image =@"" },
                new { Name = "The Central Islands",City="Paris",Caption ="City of lights", Description = "The Ile de la Cité in the middle of the Seine is the birthplace and topographical centre of Paris and has been its spiritual and legislative heart for more than 2,000 years.",image =@""  },
                new { Name = "Old-New Town",City="Prague",Caption ="A 3D architecture textbook" , Description = "The New Town covers a sizeable area. It wraps right around the Old Town on one bank of the Vltava River (across the river is the Lesser Town and the Castle District. Together these 4 areas form the city centre of Prague).",image =@"" },


            };

            var ret = new List<JObject>();

            foreach (var anLocation in simulatedLocations)
            {
                var imgBytes = Convert.FromBase64String(anLocation.image);
                var anObj = new
                {
                    Name = anLocation.Name,
                    ImageBytes = imgBytes,
                    PointsOfInterest = JerusalemPointsOfInterestsJSON,
                    City = anLocation.City,
                    Caption = anLocation.Caption,
                };

                var json = JObject.FromObject(anObj);
                ret.Add(json);
            }
        
            //Add efrat with real points
            var efratTour = new { Name = "Efrat", City = "Efrat", Caption = "7 Hills town", Description = "Gush Etzion is the rural area just 10 minutes from Jerusalem. Its natural green landscapes provide the perfect backdrop for fun family outings and meaningful activities. The fields and vineyards are still farmed using traditional methods, and you can follow the same ancient paths trodden by patriarchs and pilgrims through the centuries. In Gush Etzion, history and modernity blend together seamlessly to create memorable experiences for all ages.", image = @"" };
            var efratimgBytes = Convert.FromBase64String(efratTour.image);
            var efratanObj = new
            {
                Name = efratTour.Name,
                ImageBytes = efratimgBytes,
                PointsOfInterest = GetEfratPointsOfInterest(),
                City = efratTour.City,
                Caption = efratTour.Caption,
            };

            var efratjson = JObject.FromObject(efratanObj);
            ret.Add(efratjson);
            return ret;
            
        }

        IEnumerable<JObject> GetJerusalemPointsOfInterest()
        {
            
            var JerusalemPointsOfInterests = new List<JObject>()
            {
                JsonPoiFactory(id:1,title:"Old City Walls" ),
                JsonPoiFactory(id:2,title:"Jaffa Gate"),
                JsonPoiFactory(id:3,title:"kishla"),
                JsonPoiFactory(id:4,title:"The Tower of David"),
                JsonPoiFactory(id:5,title:"The Armenian Quarter"),
                JsonPoiFactory(id:6,title:"View to the Mount of Olives"),
                JsonPoiFactory(id:7,title:"Overview of the Temple Mount"),
                JsonPoiFactory(id:8,title:"Kidron Valley"),
            };

           
            return JerusalemPointsOfInterests;

        }

        IEnumerable<JObject> GetEfratPointsOfInterest()
        {

            var JerusalemPointsOfInterests = new List<JObject>()
            {
                JsonPoiFactory(id:101,title:"Home" ),
                JsonPoiFactory(id:102,title:"Trempiada" ),
                JsonPoiFactory(id:103,title:"Dekel shopping center"),
                JsonPoiFactory(id:104,title:"Park heasor"),
                JsonPoiFactory(id:105,title:"Saba & Savta"),
            };


            return JerusalemPointsOfInterests;

        }


        private JObject JsonPoiFactory(int id, string title)
        {
            var dataObj = this._poiSimulatedData.FirstOrDefault(d => d.Title == title);
            

            //Position position, byte[] imageBytes = null
            

            var positionObject = new JProperty("Position", dataObj.Position.Longitude, dataObj.Position.Latitude);
            var imageObject = new JProperty("imageBytes", dataObj.ImageBytes);

            JObject obj = new JObject(
                new JProperty("Id", id),
                new JProperty("Title", title),
                positionObject,
                imageObject
                );


            return obj;//.ToString().Trim();

        }

        public override JObject GetPoiGuide(IPointOfInterest pointofInterest)
        {
            
            var jsonStrTemplate =
@"{
  'PointOfInterestId': @id,
  'PointOfInterestTitle': '@title',
  'Audio': 'AQEBAQEBAQEBAQE=',
  'ImageBytes': '@imageBytes',
  'ImagesByLocation': {
    'Key': {
      'Latitude': 0.0,
      'Longitude': 0.0
    },
    'Value': null
  },
  'ImagesByLocationOnAudio': {
    'Key': '00:00:00',
    'Value': null
  },
  'Text': '@text'
}".Replace("'","\"");

            var dataHolder = this._poiSimulatedData.FirstOrDefault(d => d.Title == pointofInterest.Title);
            dataHolder = dataHolder ?? PointOfInterestSimulatedData.NullObject;
            var jsonStr = jsonStrTemplate.Replace("@id", pointofInterest.Id.ToString())
                                         .Replace("@title", dataHolder.Title)
                                         .Replace("@text", dataHolder.Text)
                                         .Replace("@imageBytes", dataHolder.ImageBytes);

            return JObject.Parse(jsonStr);
        }
    }
}
